import React from 'react';

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            validation: {
                rules: {},
                messages: {},
                valid: false,
            },
            formValue: {}
        }
    }
    componentDidMount() {
        console.log(this.props.config);
    }
    render() {
        return (
            <form name={this.props.config.name}>
                {this.props.config.elements &&
                 Object.keys(this.props.config.elements).forEach((i)=>{
                     <span>{i}</span>
                 })
                }
            </form>
        );
    }
}

export default Form;
